Shopify does not have a built-in API for currency conversion. However, you can use third-party APIs like Open Exchange Rates or Google Cloud Translation API to handle currency conversion in your Shopify store.

Here's a basic example of how you can use Open Exchange Rates API in a Shopify script:

1. First, sign up for a free API key at https://openexchangerates.org/

2. In your Shopify admin, go to Apps > Manage private apps > Create a new private app > Set the admin API access level to Read and Write > Save.

3. In your Shopify theme, create a new script tag in the Asset folder (e.g., `currency-conversion.js`).

4. Paste the following code into the script:

```javascript
// Replace YOUR_API_KEY with the API key you received from Open Exchange Rates
const apiKey = 'YOUR_API_KEY';
const baseUrl = 'https://openexchangerates.org/api/latest.json';

function convertCurrency(amount, fromCurrency, toCurrency) {
  fetch(`${baseUrl}?app_id=${apiKey}`)
    .then(response => response.json())
    .then(data => {
      const exchangeRate = data.rates[toCurrency] / data.rates[fromCurrency];
      const convertedAmount = amount * exchangeRate;
      console.log(`${amount} ${fromCurrency} = ${convertedAmount} ${toCurrency}`);
    })
    .catch(error => console.error(error));
}

// Example usage:
convertCurrency(100, 'USD', 'EUR');
